import React  from 'react';
import { useParams } from 'react-roouter-dom'
import { Col, Container, Row } from 'react-bootstrap';

//Component
import ListReportTypeOfPlayer from '../../reportType/ListReportsTypeOfPlayer';
import CommentBox from '../../component/CommentBox';
import CardReportsOfPlayer from '../../report/CardReportsOfPlayer';
//css
import './playerPage.scss';
//assets
import logo from '../../assets/img/testa-pillory.png'; // with import



const PlayerPage = () => {

    
    return (
        <Container fluid  >
            <Row>
                <Col className='col-lg-3'>
                    <p className='nickname'>Rolad</p>
                    <div className='img-top mt-5'>
                        <img alt={"dfa"} src={logo} />
                    </div>
                    <div className='comment '>
                        <CommentBox id={this.props.match.params.id} />
                    </div>
                </Col>
                <Col className='list-top-players col-lg-6'>
                    <CardReportsOfPlayer id={this.props.match.params.id} />
                </Col>
                <Col className='report-type-players pl-5  col-lg-3'>
                    <p className='title-rp mb-0'>report type</p>
                    <ListReportTypeOfPlayer id={this.props.match.params.id} />
                </Col>
            </Row>
        </Container>
    );
}

export default PlayerPage;
